import React from "react";
//import { Link } from "react-router-dom";
import "./style.css";
import Photo from "./brushing_50.png";

function About() {
    return (
        <div className="row">
            <div className="col-md-4">
                <img className="center-block" src={Photo} alt="luis brushing teeth" />
            </div>
            <div className="col-md-6">
                <p className="bio">Hello, my name is Luis Alcala. I was born and raised in Dallas, Texas. I enjoy art, sports, music, comedy, and running. I work for my family business that specializes in cumstom furniture carpentry. I'm currently learning coding and web development to help enhance my career, family, and culture.</p>
            </div>
        </div>

    );

}

export default About;
